import { Link } from "react-router-dom";
import { Button } from "../components/Button";
import styled from "styled-components";
import { Container } from "react-bootstrap";


const DisplayButton = styled.div`
display: flex;
flex-direction: row; 
gap: 2rem;
`;

export const Home = () => {
  return (
    <Container>
      <div className="Home">
        <Link to="/products" style={{textDecoration: "None", color: "black"}}>
          <img src="https://media.gq.com/photos/5a7a30cc8f045079315a6adb/16:9/w_2560%2Cc_limit/flight-club-goat-merger-gq.jpg" width="80%"></img>
          <h1>Introducing Dirty Soles Kicks</h1>
          <p>
            A collection that is around matket value. Don't miss out on another
            drop ever{" "}
          </p>
          <p>Visit the store to see our selection of exclusive sneakers.</p>
          <DisplayButton>
            <Button>Shop Now</Button>

          <Link to="/about" style={{textDecoration: "None", color: "black"}}>
            <Button>Terms</Button>
          </Link>
          </DisplayButton>
        </Link>
      </div>
    </Container>
  );
};
